(1, '2022-04-11', 'Announcement related to Internal exams of 4th Semester.', 'All students of 4th semester are hereby informed that Internal examinations would be taken on 17/7/2022 and 18/7/2022, through Google forms. Every student are advised to attend the exam, as this marks will be added to the final examination marks for evaluation.\r\n'),
(2, '2022-06-10', 'Submission deadline for 6th Semester Project synopsis.  ', 'All students appearing for B.Sc 6th Semester Examination, 2022 are hereby informed that they must submit a \"Project Synopsis\" of the project works they are preparing, to the head of the department within 20/8/2022. Any doubts related to this can be cleared by the teachers.\r\n'),
(3, '2022-08-01', 'Publishing of admit cards for 2nd Semester Examination.', ' It is hereby informed that the admit cards of all the students appearing for B.Sc 2nd Semester Examination, 2022, will be published online, on 5/8/2022, at 10 a.m. Those students who have payed the fees for the examination, will be able to download their respective admit cards from the departmental website.\r\n'),
(4, '2022-08-12', 'Declaration of holiday on the occasion of Independence day.', 'It is hereby  informed that all online class of all semesters would remain suspended on 15/8/2022, on the occasion of our 75th Independence day. Any further notices related to this, if there, will be uploaded in due time.\r\n'),
(5, '2022-08-14', ' Information about interdepartmental online quiz competition.', 'It is hereby informed that an interdepartmental online quiz competition will be organized by the department of Computer Science, on 20/8/2022. Those who are willing to participate in this, must submit their names and their partner, with whom they would pair up, within 10/8/2022, to the head of the department. We hope to see you all participating.\r\n'),
(6, '2023-01-23', 'INVITATION TO THE GRAND FEAST', 'This is to inform that a Grand Feast has been organized by the Students’ Union, Surendranath College on 31st January, 2023 for the occasion of Swarassati Puja.  All the Students, Teaching and Non-Teaching staff are cordially invited.\r\n\r\nPrincipal'),
(7, '2023-01-29', 'URGENT NOTICE FOR B.A./B.Sc./B.Com. SEMESTER-1 STUDENTS, 2022', 'Following are the ELIGIBILITY LIST FOR B.A./B.Sc./B.Com. SEMESTER-1 STUDENTS, 2022. You are directed to check it carefully and inform College office if there is any discrepancy on 30.01.2023 positively.\r\n\r\nFOR  B.A./B.Sc. SEMESTER-1 STUDENTS, 2022 (CHECK BY YOUR REGISTRATION FORM NUMBER GIVEN IN YOUR ADMISSION PAY SLIP – 115 _ _ _ _ )\r\n\r\nFOR  B.Com. SEMESTER-1 STUDENTS, 2022 (CHECK BY YOUR NAME)\r\n\r\nPrincipal'),
(8, '2023-02-04', 'Class Suspend', 'All Classes will remain suspend on and from 04.02.2023 to 15.02.2023 BA/BSC/BCOM (Hons & Gen.) Semester III (under CBCS) Examination, 2022 of Calcutta University at Surendranath College Center.\r\n \r\nPrincipal'),
(9, '2023-02-13', 'HOLIDAY', 'As per notification no. 4331-F(P2) dated 21st Oct 2022, the college will remain closed on 14th February 2023(Tuesday) on account of Birthday of \"Thakur Panchanan Brama\" a noted tribal leader and an alumni of this institution.\r\n\r\nPrincipal');

